sys_variable_value.value:
(function execute(inputs, outputs) {
    var grMember = new GlideRecord("sys_user_grmember");
    grMember.addQuery("user", inputs.user);
    grMember.addQuery("group", inputs.group);
    grMember.setLimit(1);
    grMember.query();
    if (grMember.hasNext()) {
        outputs.is_member = true;
    } else {
        outputs.is_member = false;
    }
})(inputs, outputs);

